import React from 'react'
import {Drawer} from '@material-ui/core'

interface IProps{
    open: boolean
    handleClose: () => void
}

const SideMenu: React.FC<IProps> = (props) =>{

    const {open, handleClose} = props
    
    return(
        <Drawer
            anchor='left'
            open = {open}
            onClose={handleClose}>
            Test Me!
        </Drawer>
    )
}

export default SideMenu;
